<p>As of Friday, Irena is the bookies' favourite to win The Bachelor, with Sportsbet offering odds of just $1.30.</p>

<p>Bella Varelis is tipped for second place ($3.25) and Bec Cvilikas is expected to place third ($7.50). Izzy Sharman-Firth is the outsider at $15.</p>

